import java.util.Base64;
import java.util.List;
import java.util.ArrayList;
import java.util.Iterator;
import java.io.UnsupportedEncodingException;
import com.google.zetasketch.HyperLogLogPlusPlus;

public class BqHll {
    public static Long bqMerge(List<String> stringSketches) throws UnsupportedEncodingException {
        if(stringSketches.isEmpty()) return 0L;

        Iterator<String> it = stringSketches.iterator();

        byte[] first = Base64.getDecoder().decode(it.next().getBytes("UTF-8"));
        HyperLogLogPlusPlus<String> rst = (HyperLogLogPlusPlus<String>) HyperLogLogPlusPlus.forProto(first);

        while(it.hasNext()) {
            byte[] byteSketch = Base64.getDecoder().decode(it.next().getBytes("UTF-8"));
            HyperLogLogPlusPlus<String> hll = (HyperLogLogPlusPlus<String>) HyperLogLogPlusPlus.forProto(byteSketch);
            rst.merge(hll);
        }
        return rst.result();
    }

    // Example usage
    public static void main(String[] args) {
        List<String> hllStrings = new ArrayList<>();
        hllStrings.add("");
        hllStrings.add("");

        try {
            Long res = bqMerge(hllStrings);
            System.out.println(res);
        } catch (UnsupportedEncodingException e) {
            System.out.println(e);
        }
    }
}
